import {BrowserRouter, Route, Switch} from 'react-router-dom'
import ContentMain from './pages/ContentMain'

const Routes = () => {
  return(
    <BrowserRouter>
      <Switch>
        <Route exact path="/" component={ContentMain}/>
        <Route exact path="/sobre" componet={ContentMain}/> 
    </Switch>
    </BrowserRouter>
    
  )
}

export default Routes
